if mibBuilder.loadTexts: mpanlDlciTransferPriToNwk.setDescription('This attribute indicates the priority at which data is transferred to the network. The transfer priority is a preference configured for an application according to its delay-sensitivity requirement. Frames with higher transfer priority are served by the network before the frames with lower priority. The transfer priority standard is defined to have 16 indices from 0 to 15. Each transfer priority n, where n specifies the transfer priority index, contains a default setting for routing class of service (multimedia, delay or throughput) and frame relay egress queue (depending on the number of supported egress queues on the remote end interface) specified by the routingClassOfService and emissionPriority attributes provisioned in the Mod Frs DprsNet Tpm/n component. The default mapping can be altered by a user if required.')
